import './App.css';
import styled,{ThemeProvider} from 'styled-components';
import theme from './styles/theme';

const Wrapper = styled.div`
`
const SearchButton = styled.button`

`

function App() {
  return (
    <ThemeProvider theme={theme}>
      <SearchButton>Button</SearchButton>
    </ThemeProvider>
  );
}

export default App;
